int longestContinuousSubstring(string s) {
    ll ans = 0,cntr = 0;
    for(ll i = 0;i<s.size()-1;++i){
        if(s[i]+1 == s[i+1]){
            ++cntr;
        }else{
            cntr = 0;
        }
        ans = max(ans,cntr);
    }
    return ans;
}

struct TreeNode {
    int val;
    TreeNode *left;
    TreeNode *right;
    TreeNode() : val(0), left(nullptr), right(nullptr) {}
    TreeNode(int x) : val(x), left(nullptr), right(nullptr) {}
    TreeNode(int x, TreeNode *left, TreeNode *right) : val(x), left(left), right(right) {}
};

TreeNode* insertValue(TreeNode* root, int value,queue<TreeNode*>& q){
    TreeNode* node = new TreeNode(value);
    if (!root){root = node;}
    else if(!q.front()->left){
        q.front()->left = node;
    }else{
        q.front()->right = node;
        q.pop();
    }
    q.push(node);
    return root;
}

TreeNode* createTree(vector<ll> &arr, int n)
{
    TreeNode* root = NULL;
    queue<TreeNode*> q;
    for (ll i = 0; i < n; i++)
      root = insertValue(root, arr[i], q);
    return root;
}

TreeNode* reverseOddLevels(TreeNode* root) {
    if(!root){return NULL;}
    queue<TreeNode*> q,par;
    q.push(root);
    ll f = 1;
    vector<TreeNode*> dk;
    while(!q.empty()){
        ll sz = q.size();
        vector<TreeNode*> tmp;
        while(sz--){
            auto p = q.front();q.pop();
            tmp.push_back(p);
            if(p->left){q.push(p->left);}
            if(p->right){q.push(p->right);}
        }
        if(!f){reverse(all(tmp));}
        for(auto it:tmp){dk.push_back(it);}
        f ^= 1;
    }

    vector<ll> ak;
    for(auto it:dk){ak.push_back(it->val);}
    TreeNode* ans = createTree(ak,ak.size());
    return ans;
}


