class node
{
    public:
    int count;
    node* next[26];

    node()
    {
        count = 0;
        for(int i=0;i<26;i++)
        {
            next[i] = NULL;
        }
    }
};

vector<int> sumPrefixScores(vector<string>& words) 
{
    node* root = new node();

    for(int i=0;i<words.size();i++)
    {
        node* temp = root;
        string word = words[i];
        for(int j=0;j<(word.length());j++)
        {
            char ch = word[j];

            if(temp->next[ch-'a'] == NULL)
            {
                temp->next[ch - 'a'] = new node();
            }
            temp = temp->next[ch-'a'];             
            temp->count++;   
        }
    }      
    vector<int>ans;
    for(int i=0;i<words.size();i++)
    {
        string word = words[i];
        node* temp = root;
        int val = 0;
        
        for(int j=0;j<word.length();j++)
        {
                char ch = word[j];
                temp = temp->next[ch-'a'];
                val = val + temp->count;         
        }
        ans.push_back(val);
    }
    return ans;
}

vector<ll> sumPrefixScoress(vector<string>& s) {
    ll n = s.size();
    vector<string> dk = s;
    sort(s.begin(),s.end());

    unordered_map<string,ll> mp;
    for(ll i = 0;i<n;++i){
        string st = s[i];
        string tmp;
        for(ll j = 0;j<st.size();++j){
            tmp += st[j];
            mp[tmp]++;
        }
    }

    vector<ll> ans,vis;
    vector<pair<string,ll>> ms;
    for(ll i = 0;i<n;++i){
        string st = s[i];
        string tmp;
        ll mx = 0;
        for(ll j = 0;j<st.size();++j){
            tmp += st[j];
            mx += mp[tmp];
        }
        ms.push_back({s[i],mx});
    }
    
    for(ll i = 0;i<n;++i){
        string tmp = dk[i];
        for(ll j = 0;j<ms.size();++j){
            if((!vis[j]) and (ms[j].first == tmp)){
                vis[j] = 1;
                ans.push_back(ms[j].second);
            }
        }
    }
    return ans;
}

